// import cardImage from '../public/images/'
import style from 'next/css'

export default function Card({ word }) {

  const cardStyle = style({ background: 'url(/static/card.png) no-repeat center center scroll' })
  return (
    <main>
      <div className="word">{word}</div>
      <style jsx>{`
        main {
          display: flex;
          flex-basis: 20%;
          text-align: center;
          align-content: center;
          justify-content: center;
          width: 100%;
          margin: 0 4px;
        }
        .word {
          display: flex;
          align-self: center;
          justify-content: center;
          position: absolute;
          background: url(${'/card'})) no-repeat;
        }
        .author {
          font-family: sans-serif;
          color: #559834;
          font-size: 20px;
        }
      `}</style>
    </main>
  )
}
